import Header from "./components/comp_todoList/comp_header/header_comp";
import TodoList from "./components/comp_todoList/todoList_comp";
import {useState} from "react";

function App() {
    const [count,setCount] = useState(0)
    const [todos, setTodos] = useState([
        {id: 1, value: "Начать Todo", isDone: false},
        {id: 2, value: "Закончить Todo", isDone: false}
    ])

    return (
        <div className="App">
            <Header/>
            <TodoList todos={todos}
                      setTodos={setTodos}
                      setCount={setCount} count={count}/>
            {count}
        </div>
    );
}

export default App;
